  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Structures are derived from two scales
  of a focal mean analysis on bathymetry and slope. The grid is based on gridded (40
  m cell size) multibeam bathymetry, collected aboard R/V AHI and NOAA ship Hi'ialakai.
  BPI Structures was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
  Cell values represent one of 12 classes in an index of seafloor terrains. This data
  set is for Howland Island, Pacific Remote Island Areas, Central Pacific.\",\n\t\"license_title\":
